css:
@-moz-document url-prefix("https://dashboard.sketchymedical.com") {
.sk-light-font {
    color:#fffaf0
}
.sk-dark-font {
 color:#fffaf0!important
}
.uk-margin-small-left{
 color:#fffaf0
}
.uk-text-center{
 color:#fffaf0
}
.uk-accordion-content {
 background-color: #1b2337;
 color: #fffaf0;
}
.uk-list-striped>li:nth-of-type(odd) {
 background-color: #2a3c66;
}
.uk-accordion {
 background-color: #2a3c66;
}
.sk-qbank-result-subnav[_ngcontent-c14] *{
 color:#fffaf0 !important
}
.progress-inner[_ngcontent-c15] {
    color:#000!important;
}
.sk-bg-light {
    background-color:#1b2337
}
.uk-section-muted {
    background: #161c2b;
    color: #fffaf0;
}
.uk-icon-button {
    background:unset
}
.uk-table-striped tbody tr:nth-of-type(odd),
.uk-table-striped>tr:nth-of-type(odd) {
 background:#18454d;
 border-top:1px solid #e5e5e5;
 border-bottom:1px solid #e5e5e5;
}
.sk-question-stat-container {
 background-color:#12153e;
 padding:15px 0
}
.sk-qbank-answer-correct {
 background:#3b5e30;
 border-radius:10px
}
.sk-qbank-review-container {
 background-color:#1b2337;
}
.sk-qbank-sketchymode-title {
    color:#fffaf0
}
.sk-review-background  {
    background-color: #1b2337!important;
}
.uk-modal-dialog {
 background:#1e2237;
 color:#fffaf0!important
}
.html{
 color:#fffaf0!important
}

.uk-modal-header {
 background:#1b2337;
}
.uk-modal-footer {
 background:#7595e1;
}

.uk-notification-message{
 background:#1B2337;
    color:#FFFAF0;
}
}
